import React from 'react'
import { Link } from 'react-router-dom';
import './Header.scss';

 function Header() {
  return (
    <div className='main-header'>
        <div className='main-header-container'>
            <Link to='/'>TELEGRAFI</Link>
            <Link to='/'>Lajme</Link>
            <Link to='/sport'>Sport</Link>
        </div>
    </div>
  )
}
export default Header;
